import React, { useState } from "react";
import Logowanie from "./Logowanie";
import RegistrationPage from "./RegistrationPage";
import '../style/index.css'
import Session from './Session'
function StartWeb() {
    const [page, setPage] = useState('login');
  
    const handleLoginClick = () => {
      setPage('login');
    };
  
    const handleRegisterClick = () => {
      setPage('register');
    };
    const handleClick = () => {
      setPage('logout');
      Session.clearSession();
    };
    return (
      <div>
      {Session.getSession === false ?(
      <div>
        <p>
          {page === 'login' ? (
            <span id="loginB">
              Don't have an account? <button  onClick={handleRegisterClick}>Register here</button>
            </span>
          ) : (
            <span>
              Already have an account? <button id="registerB" onClick={handleLoginClick}>Login here</button>
            </span>
          )}
          </p>
        {page === 'login' ? (
          <Logowanie />
        ) : (
          <RegistrationPage />
        )}
            
          </div>)
          :(
          
            <div>
                <span>
             Zalogowany <button id="wyloguj" onClick={handleClick}>Wyloguj</button>
            </span>
          </div>
          )
          }
      </div>
    )}
          
export default StartWeb;
